The node software will no longer book ledger mutations to non-migration addresses. This means that users are incentivized to migrate their funds as they want to use their tokens. See this document on what migration addresses are. A migration bundle is defined as follows: It contains exactly one output transaction of which the destination address is a valid migration address and is positioned as the tail transaction within the bundle. The output transaction value is at least 1'000'000 tokens. It does not contain any zero-value transactions which do not hold signature fragments. This means that transactions other than the tail transaction must always be part of an input. Input transactions must not use migration addresses. The node will only use tail transactions of migration or milestone bundles for the tip-pool. This means that past cones referenced by a milestone will only include such bundles. The legacy node software is updated with an additional HTTP API command called getWhiteFlagConfirmation which given request data in the following form: { "command": "getWhiteFlagConfirmation", "milestoneIndex": 1434593
} returns data for the given milestone white-flag confirmation: { "milestoneBundle": [ "SDGKWKJAG...", "WNGHJWIFA...", "DSIEWSDIG..." ], "includedBundles": [ [ "SKRGI9DFS...", "NBJSKRJGW...", "ITRUQORTZ..." ], [ "OTIDFJKSD...", "BNSUGRWER...", "OPRGJSDFJ..." ], ... ]
} where milestoneBundle contains the milestone bundle trytes and includedBundles is an array of tryte arrays of included bundles in the same DFS order as the white-flag confirmation. Trytes within a bundle "array" are sorted from currentIndex = 0 ascending to the lastIndex. This HTTP API command allows interested parties to verify which migration bundles were confirmed by a given milestone.

