A system to support interoperable royalty payments across dApps. Allowing universal secondary market reward systems to be integrated through-out the ecosystem. Integration of such systems is at the choosing of the dApp developer but is encouraged to support creator royalties. Royalty addresses may be defined under the royalties key within the NFT metadata. The key inside the royalties object must be a valid iota1/smr1 address where royalties will be sent to. The value must be a numeric decimal representative of the percentage required ie. 0.05=5% { ... "royalties": { "iota1...a": 0.05 }
} In the event there are further royalty, multiple royalty addresses could be used in the form of an object where the address and percentage are mapped in a key value format inside the royalties field. { ... "royalties": { "iota1...a": 0.025, "iota1...b": 0.025, "iota1...c": 0.025, "iota1...d": 0.025 }
} The total decimal sum of all royaltyPercentage must never exceed 1 and is recommended not to exceed 0.5. If royalties exists, it is iterated over the keys and then all the royalties are paid out till there are no keys left to iterate over.

