For ease of development and interoperability between applications within the ecosystem an extendable schema standard is defined to support ease of integration of NFTs for developers. Each schema is defined by three main keys: standard – the standard model schema – the defined schema type version – the version of the standard Universal schema Each NFT schema should consist of a collection of universal keys to define key properties of the NFT The standard defined is: IRC27 The schema type is defined as a MIME type , for example: Image files: image/jpeg, image/png, image/gif, etc. Video files: video/x-msvideo (avi), video/mp4, video/mpeg, etc. Audio files: audio/mpeg, audio/wav, etc. 3D Assets: model/obj, model/u3d, etc. Documents: application/pdf, text/plain, etc. You may find all common MIME types in IANA's registry . Custom file types might define their own MIME types. The version is defined by the version number used preceded with the letter v, current version: v1.0 Define the standard, the type, and the version: { "standard": "IRC27", "type": "image/jpeg", "version": "v1.0"
} Additional keys that must be included in every NFT schema: uri – url pointing to the NFT file location with MIME type defined in type. name - alphanumeric text string defining the human identifiable name for the NFT { "standard": "IRC27", "version": "v1.0", "type": "image/jpeg", "uri": "https://mywebsite.com/my-nft-files-1.jpeg", "name": "My NFT #0001"
} Optional, but recommended keys, that may be included in NFT schema include: collectionName – alphanumeric text string defining the human identifiable collection name royalties - Object containing key value pair where payment address mapped to the payout percentage issuerName – alphanumeric text string to define the human identifiable name of the creator description – alphanumeric text string to define a basic description of the NFT attributes - Array objects defining additional attributes of the NFT { "standard": "IRC27", "version": "v1.0", "type": "image/jpeg", "uri": "https://mywebsite.com/my-nft-files-1.jpeg", "name": "My NFT #0001", "collectionName": "My Collection of Art", "royalties": { "iota1...a": 0.025, "iota1...b": 0.025 }, "issuerName": "My Artist Name", "description": "A little information about my NFT collection"
} In addition to the required and recommended schema, the inclusion of attributes allows for versatile expansion for NFT metadata. attributes are the attributes for the item, which will show up on dApps like NFT Marketplaces. IRC27 NFT metadata follows the OpenSea metadata standards . { "standard": "IRC27", "version": "v1.0", "type": "image/jpeg", "uri": "https://mywebsite.com/my-nft-files-1.jpeg", "name": "My NFT #0001", "collectionName": "My Collection of Art", "royalties": { "iota1...a": 0.025, "iota1...b": 0.025 }, "issuerName": "My Artist Name", "description": "A little information about my NFT collection" "attributes": [ { "trait_type": "Background", "value": "Purple" }, { "trait_type": "Element", "value": "Water" }, { "trait_type": "Attack", "value": "150" }, { "trait_type": "Health", "value": "500" } ]
}

