The issuer includes the Collection NFT in a transaction that mints NFTs within the collection. The number of mintable NFTs in one transaction is defined by the protocol as the Max Outputs Count defined in TIP-22 - 1 (the Collection NFT is also part of the outputs). The minted NFTs will have the following properties: nftId: the unique identifier of the NFT output assigned by the protocol upon minting. immutableIssuer: is set as collectionId of the Collection NFT. This unique value identifies which collection the NFT belongs to. immutableMetadata: metadata for the individual NFT. Binary blob of an IRC-27 compliant JSON object. For item 4 for example, the metadata is: { "standard": "IRC27", "version": "v1.0", "type": "image/gif", "uri": "https://my-awesome-nft-project.com/item-4.gif", "name": "#4 My Awesome NFT", "issuerName": "Me", "royalties": { "smr1q5948....": 0.05 }, "collectionName": "My Awesome NFT Collection", "attributes": [ { "trait_type": "awesomeness", "value": 60 }
]
} In case the metadata is not stored in the NFT output but is hosted off-chain, it is still recommended to include information in the immutableMetadata field such that clients are able to locate it. The immutableMetadata json object would look something like: {
"standard": "IRC27",
"version": "v1.0",
"type": "application/json",
"uri": "https://my-awesome-nft-project.com/{id}.json",
"name": "#4 My Awesome NFT"
} Note the {id} substitution in the uri field. Clients should replace id with the nftId property of the NFT output, without the 0x prefix.

